var _hoisted_1 = /*#__PURE__*/(0,vue__WEBPACK_IMPORTED_MODULE_0__.createStaticVNode)("<h1>Nuestra Poltica de Privacidad</h1><p style=\"text-align:center;\"></p><p><strong>UFV MyParking</strong>para proteger los derechos individuales, sobre todo en relacin con los tratamientos automatizados y con voluntad de ser transparentes con el Usuario, ha establecido una poltica que recoge el conjunto de dichos tratamientos, los fines perseguidos por estos ltimos, la legitimidad de los mismos y tambin los instrumentos a disposicin del Usuario para que pueda ejercer sus derechos.</p><p>La navegacin en este sitio web implica la total aceptacin de las siguientes disposiciones y condiciones de utilizacin. Se aceptar la utilizacin de cookies. En caso de no estar de acuerdo envaun correo electrnico a <a href=\"ufvmyparking@gmail.com\">ufvmyparking@gmail.com</a></p><p>La versin actualizada de esta poltica de privacidad es la nica aplicable durante la duracin del uso del sitio web hasta que no haya otra versin que la sustituya.</p><p>Para una ms informacin complementaria sobre la proteccin de datos personales te invitamos a consultar la pgina web de la AEPD (Agencia Espaola de Proteccin de Datos)<a href=\"https://www.agpd.es/portalwebAGPD/index-ides-idphp.php\">https://www.agpd.es/portalwebAGPD/index-ides-idphp.php</a></p><h3>Recogida de datos</h3><p>Tus datos son recogidos por el TITULAR.</p><p>Un dato de carcter personal se refiere a toda la informacin referida a una persona fsica identificada o identificable (persona afectada). Se entiende como identificable una persona que pueda ser identificada, directa o indirectamente, sobre todo por referencia a un nombre, un nmero de identificacin (DNI, NIF, NIE, pasaporte) o a uno o varios elementos especficos, propios a su identidad fsica, fisiolgica, gentica, psquica, econmica, cultural o social.</p><p>Los datos que con carcter general sern recopilados en los formularios son: Nombre, Comentario y Correo. Se podrn recopilar otro tipo de datos dependiendo del formulario siendo as siendo informado el Usuario. Adems las de caracter especfico para <strong>peticin de ayuda de un centro de salud</strong> siendo, correo, nombre del centro, direccin, persona de contacto, nmero de telfono para contacto, lugar de entrega, cantidad de pantallas-viseras: (indicar que son reutilizables, por lo que se suele calcular en funcin del n de personas que vayan a trabajar simultneamente)</p><h3>Con qu finalidad se tratantus datos personales?</h3><p>La finalidad del tratamiento de los datos personales que se puedan recoger son usarlos principalmente por el TITULAR para la gestin de su relacin contigo,poder ofrecerte productos y servicios de acuerdo con tus intereses, mejorar tu experiencia de usuario y en su caso, para el tratamiento de sus solicitudes, peticiones o pedidos. Se elaborar un perfil comercial en base a la informacin que lefacilites. No se realizarn decisiones automatizadas en base a dicho perfil.</p><p>Los datos proporcionados se conservarn mientras se mantenga la relacin comercial, siempre que no sesolicite por el interesado su supresin, o durante los aos necesarios para cumplir las obligaciones legales.</p><p>Se registrarn en el fichero de cliente y su tratamiento quedar registrado en el registro de tratamientos que debe llevar el TITULAR (antes del 25 de mayo de 2018 tambin podra estar incluido en el fichero elaborado con los datos personales registrado en la AEPD (Agencia Espaola de Proteccin de datos) u rgano competente de las respectiva Comunidad Autnoma). </p><h3>Cul es la legitimacin para el tratamiento de tus datos?</h3><p>La base legal para el tratamiento de tusdatos personales es:</p><p>- La correcta ejecucin o cumplimiento del contrato</p><p>- El inters legtimo del TITULAR</p><p>- El consentimiento del usuario o cliente para el tratamiento de sus datos</p><h3>A qu destinatarios se comunicarn los datos?</h3><p>Los datos personales del Usuario podrn eventualmente ser comunicados a terceros relacionados con el TITULAR por contrato para la realizacin de las tareas necesarias para la gestin de su cuenta como cliente y sin que tenga que dar su autorizacin</p><p>Tambin cuando tuvieran que hacerse comunicaciones a las autoridades en caso de que el Usuario hubiera realizado acciones contrarias a la Ley o incumplido el contenido del aviso legal</p><p>Los datos del Usuario podrn comunicarse a otras empresas del grupo, si las hubiese, para fines administrativos internos que podran suponer un tratamiento de esos datos.</p><p>Los datos personales del Usuario podrn transferirse a un tercer pas o a una organizacin internacional, perose le deber informar cuando se vaya a producir esa transferencia, y de las condiciones de la misma y del destinatario.</p><p>Cuando algunos datos sean obligatorios para acceder a funcionalidades concretas del sitio web, el TITULAR indicar dicho carcter obligatorio en el momento de la recogida de datos del Usuario.</p><h3>Cookies</h3><p>Al navegar por este sitio, las cookiesdel TITULARdel sitio en cuestin y / o de las compaas de terceros, pueden depositarse en su ordenador, tablet o telfono mvil. Durante la primera navegacin, aparecer un bannerexplicativo sobre el uso de cookies.<br> Por lo tanto, al continuar la navegacin, el Usuario serconsideradocomo informadoy habraceptado el uso de dichas &quot;cookies&quot;. El consentimiento otorgado ser vlido por un perodo de trece meses.</p><h3>Qu son las Cookies?</h3><p>Una cookie es un fichero que se descarga en el equipo del Usuario al acceder a determinadas pginas web. Las cookies permiten a una pgina web, entre otras cosas, almacenar y recuperar informacin sobre los hbitos de navegacin de un usuario o de su equipo y, dependiendo de la informacin que contengan y de la forma en que utilice su equipo, pueden utilizarse para reconocer al usuario.</p><p>Las cookies, en funcin de quin gestiona el equipo o dominio desde las que se envan, pueden dividirse en cookies propias (gestionadas por un equipo o dominio gestionado por el propio editor del sitio web) o cookies de terceros (gestionados por terceras entidades que tratan los datos obtenidos a travs de stas).</p><p>Segn el plazo de tiempo que permanecen activadas, puede distinguirse entre cookies de sesin (diseadas para recabar y almacenar datos mientras el usuario accede a una pgina web) y cookies persistentes (en las que los datos siguen almacenados en el terminal y pueden ser accedidos y tratados durante un periodo definido por el responsable de la cookie).</p><hr><h5>Cookies de anlisis:</h5><p>Son aqullas que nos permiten cuantificar el nmero de Usuarios y as realizar la medicin y anlisis estadstico de la utilizacin que hacen del servicio ofertado. Para ello se analiza su navegacin en nuestro Portal con el fin de introducir mejoras en el funcionamiento del mismo y/o mejorar los productos o servicios ofertados. En particular, utilizamos las siguientes cookies de anlisis:</p><p><strong>Cookies de Google Analytics.</strong> A travs de Google Analytics se obtiene informacin que nos permite medir cmo interactan los Usuarios con el contenido del Portal. Origen: Google Inc.</p><p class=\"lefttext\">Ms informacin: <a href=\"https://developers.google.com/analytics/devguides/collection/analyticsjs/cookie-usage?hl=es\" target=\"_blank\">https://developers.google.com/analytics</a></p><hr><h5>Cookies de personalizacin:</h5><p>Son aqullas que permiten al Usuario acceder al servicio con algunas caractersticas de carcter general predefinidas en funcin de una serie de criterios en el terminal del usuario como por ejemplo seran el idioma, el tipo de navegador a travs del cual accede al servicio, la configuracin regional desde donde se accede al servicio, etc.</p><hr><h3>Cmo deshabilitar el uso de Cookies</h3><p>El Usuario puede en cualquier momento deshabilitar el funcionamiento de las cookies del Portal mediante la configuracin del navegador, pero puede que esto afecte a la capacidad de navegar por el Portal o a la correcta utilizacin de algunas de las funciones de ste.</p><p>Puede consultar como hacerlo en cada navegador siguiendo los siguientes links:</p><p class=\"lefttext\"><span>Si utiliza <strong>Chrome</strong>, desde <a href=\"https://support.google.com/chrome/answer/95647?hl=es&amp;ref_topic=3434352\" target=\"_blank\">https://support.google.com/chrome/</a></span><br><span>Si utiliza <strong>Explorer</strong>, desde <a href=\"https://support.microsoft.com/es-es/help/17442/windows-internet-explorer-delete-manage-cookies\" target=\"_blank\"> https://support.microsoft.com/es-es/help</a></span><br><span>Si utiliza <strong>Firefox</strong>, desde <a href=\"https://support.mozilla.org/es/kb/habilitar-y-deshabilitar-cookies-sitios-web-rastrear-preferencias\" target=\"_blank\"> https://support.mozilla.org/es/kb/habilitar-y-deshabilitar-cookies-sitios-web-rastrear-preferencias</a></span><br><span>Si utiliza <strong>Safari</strong>, desde <a href=\"https://support.apple.com/kb/PH21411?viewlocale=es_ES&amp;locale=es_ES\" target=\"_blank\"> https://support.apple.com/kb/PH21411?viewlocale=es_ES&amp;locale=es_ES</a></span></p><hr><h3>Actualizaciones y cambios en la Poltica de Cookies</h3><p class=\"pred\"><strong>UFV MyParking</strong> se reserva el derecho a introducir modificaciones en esta Poltica de Cookies, por ello se aconseja a los Usuarios que la visiten peridicamente.</p><p>Cuando se produzcan cambios significativos en esta Poltica de Cookies, se comunicarn a los Usuarios para su aceptacin mediante avisos en el Portal o a travs de correo electrnico o bien travs de cualquier otro procedimiento adecuado segn las circunstancias.</p><p>Si tiene dudas sobre esta Poltica de Cookies, puede contactar con nosotros en este correo electrnico: <a href=\"ufvmyparking@gmail.com\">ufvmyparking@gmail.com</a></p><h3>Derechos del usuario</h3><p>Se informa al usuario de la posibilidad de ejercer sus derechos de acceso, rectificacin, cancelacin y oposicin. Tambin cada persona dispone del derecho de limitacin del tratamiento relativo a su persona, de un derecho de eliminacin de transferencia de datos personales transmitidos al responsable del tratamiento y del derecho a la portabilidad de sus datos.</p><p>El usuario tiene la posibilidad de presentar una reclamacin ante la AEPD (Agencia Espaola de Proteccin de Datos) u organismo competente de la respectiva Comunidad Autnoma, cuando no haya obtenido una solucin satisfactoria en el ejercicio de sus derechos mediante un escrito dirigido a la misma.</p><p>Salvo que el Usuario se oponga, enviando un emaila la direccin de correo electrnico <a href=\"ufvmyparking@gmail.com\">ufvmyparking@gmail.com</a>, sus datos podrn ser utilizados, en su caso, si procede, para el envo de informacin comercial de <strong>UFV MyParking</strong></p><p>Los datos proporcionados se conservarn mientras se mantenga la relacin comercial o durante los aos necesarios para cumplir las obligaciones legales.</p><p>El Usuario es responsable de que la informacin que proporcione a travs de esta pgina web sea cierta, respondiendo de la exactitudde todos los datos que comunique y mantendr actualizada la misma para que reflejen una situacin real, siendo responsable de informaciones falsas o inexactas que proporcione y de los daos, molestias y problemas que pudieran causar al UFV MyParking o a terceros.</p><p>Esa informacin ser guardada y gestionada con la debida confidencialidad, aplicando las medidas de seguridad informticanecesarias para impedir el acceso o uso indebido de sus datos, su manipulacin, deterioro o prdida</p><p>No obstante, el Usuario debe tener en cuenta que la seguridad de los sistemas informticos nunca es absoluta. Cuando se facilitan datos personales por internet, dicha informacin pudiera ser recogida sin su consentimiento y tratada por terceros no autorizados.</p><p>UFV MyParking declina, cualquier tipo de responsabilidadsobre las consecuencias de esosactos puedan tener para el Usuario, si public la informacin voluntariamente.</p><p>Podr acceder y ejercitar esos derechos mediante solicitud por escritoy firmada que podr ser enviada al siguiente correo electrnico: <a href=\"ufvmyparking@gmail.com\">ufvmyparking@gmail.com</a> adjuntando fotocopia del DNI o documento equivalente.</p><p>Adems de lo anterior, y en relacin conla normativa de proteccin de datos, los usuarios que lo soliciten, tienen la posibilidad de organizar el destino de sus datos despus de su fallecimiento.</p>", 60);

